import { Route, RouterProvider, Routes } from 'react-router';
import { BrowserRouter, Link } from 'react-router-dom';
import styled from 'styled-components';
import { AllItemPage } from '../AllItemPage/AllItemPage';

export const HomeHeader = () => {
  return (
    <BrowserRouter>
      <nav>
        <div>
          <Header>
            <Title>lachambre online store</Title>
            <Subtitle>
              <p>Brand</p>
              <Link to="/Allitem">Allitems</Link>
              <p>about</p>
              <p>contucts</p>
            </Subtitle>
          </Header>
        </div>
      </nav>
    </BrowserRouter>
  );
};
const Header = styled.header`
  background-color: #ffb6c1;
  width: 100%;
  margin-top: 0%;
  padding: 0%;
`;

const Title = styled.h1`
  margin-top: 0;
  font-size: 30px;
  color: aliceblue;
`;

const Subtitle = styled.div`
  display: flex;
  gap: 16px;
  justify-content: center;
  margin-top: 0px;
  color: aliceblue;
`;
